import axios from "axios";
import API_URL from "./backendConfig";

const searchUser = () => {
    return axios.post(API_URL + "friend/search")

};
const getFriends = () => {
    return axios.post(API_URL + "friend/getFriends")

};
const friendpageService = {
    searchUser,
    getFriends
};

export default friendpageService;
